Assassin's Creed: Revelations (c) Ubisoft        


Region      : Region Free
Languages: English
Size        : 1 DVD
Genre    : Action/Adventure
Platform    : XBOX 360
Date     : November 2011


  When a man has won all his battles and defeated his enemies; what is left 
  for him to achieve? Ezio Auditore must leave his life behind in search of 
  answers, In search of the truth.  

  In Assassin's Creed Revelations, master assassin Ezio Auditore walks in the 
  footsteps of the legendary mentor Altair, on a journey of discovery and 
  revelation. It is a perilous path - one that will take Ezio to 
  Constantinople, the heart of the Ottoman Empire, where a growing army of 
  Templars threatens to destabilise the region.

  In addition to Ezio's award-winning story, a refined and expanded online 
  multiplayer experience returns with new and additional modes, maps and 
  characters, allowing you to test your assassin skills against others from 
  around the world.


